import React from 'react';
import logo from './Fitbit_logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Welcome to the fitbit meal client
        </p>
        <button onClick={signInButton}>
          Access Account
        </button>

      </header>
    </div>
  );
}

export default App;
